import java.text.SimpleDateFormat
GregorianCalendar calendar = new GregorianCalendar()
def dateFormat = new SimpleDateFormat("yyyy-MM-ddhhmm") def currentTime = dateFormat.format(calendar.getTime()).toString() log.info currentTime Today = currentTime.substring(0,10) log.info(Today) Hour = currentTime.substring(currentTime.length()-4,currentTime.length()-2) log.info(Hour) Min = currentTime.substring(currentTime.length()-2,currentTime.length()) log.info(Min) date = Today + "T" + Hour + ":" + Min + "Z" log.info date context.testCase.testSuite.project.setPropertyValue("Date",date);

